import React from 'react';
import "../CSS/ProjectList.css";

function ProjectList() {

    const images = [calculator, chatApp, clipboardLanding, formValidation, fyloLanding, guessNumber, orderSummary, rockPaper, taskManager, testimonialGrid, toDoList, weatherApp];

    return (
        <div className="ProjectList">

            {images.forEach((image)=>{
                <Projects img={image}/>
            })}

        </div>
    )
}
export default ProjectList;
